import React from "react";
import { AppBar, Tabs, Tab, Typography } from "@material-ui/core";
import { TabPanel } from "@material-ui/lab";
const NavBar = () => {
  return (
    <div>
      <AppBar position="static">
        <ToolBar>
          <Typography variant="title" color="inherit">
            React Sample
          </Typography>
        </ToolBar>
      </AppBar>
    </div>
  );
};

export default NavBar;
